import List from './list';
import Title from './title';

class Main extends Component{
    render(){
      return(
        <div>
          <Title title = {'React (Create)Elements Render'} />
          <List tasks = {['Study', 'Go for a run', 'Have lunch']} />
          <Title title = {'JSX Elements Render'} />
          <List tasks = {['Rest', 'Talk to wife', 'Talk to family', 'MMA Training', 'Consume shake', 'Cook dinner']} />
        </div>
      );
    }
}

export default Main;
